INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (16614, 1, 1, 102711, "………………そう、ですか。\nそれならありがたく\nいただくことにしましょう。", 10, 11, 16614078, 0, 0, 0.5);
