INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (18814, 1, 1, 100911, "シグルドからも助言を得ている。\nナナカ生誕を祝すのにふさわしい、\n伝説級の品々を用意してあるぞ？\n限定魔法少女グッズの詰め合わせだ！", 10, 11, 18814086, 0, 0, 0.5);
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (18814, "", "", 0, "", "", 91, 18814087, "", "", "");
