INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (19814, 1, 1, 105311, "そんなわけあるか！！\n今日はニノンの誕生日なんだから、\nお祝いのケーキに決まっているだろう！", 10, 11, 19814076, 0, 0, 0.5);
