INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (21314, 1, 1, 111011, "チエル君。ひと月前から騒いでおいて、\n何を今さら白々しいこと言っとるんだ。\nいいから大人しく祝われたまえ。\nハイおめちぇるー、全員拍手ー", 10, 11, 21314060, 0, 0, 0.5);
