INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (25214, 1, 1, 104911, "わあ、素敵なケーキだね。\nお姉ちゃんのために\n弟くんが用意してくれたの？\n愛を感じちゃうなあ。", 10, 11, 25214056, 0, 0, 0.5);
