INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (27814, 1, 1, 104511, "た、誕生日を祝ってもらえるなんて……\nありがとうございます。\nで、でもドＳさんがいるということは\nこの後にどんでん返しが……じゅるり♪", 10, 11, 27814093, 0, 0, 0.5);
