INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (28414, 1, 1, 100511, "わわっ、大きなケーキッス！\n……え、もしかして自分のッスかねっ？\n誕生日覚えてくれてたッスか？", 10, 11, 28414063, 0, 0, 0.5);
