INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (28414, 1, 1, 104711, "おめでとう、マツリちゃん。\n私たちだけではなく、\n少年も一緒に準備してくれたんだよ。", 10, 11, 28414073, 0, 0, 0.5);
