INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114, 1, 1, 100611, "え～、プリンなんて食べたら\nなくなっちゃうよ～？\nアクセサリーとかの方がいいかな？", 10, 11, 31114081, 0, 0, 0.5);
INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114, "", "", 0, "", "", 91, 31114082, "", "", "");
