INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (31114, 1, 1, 102211, "ほ、欲しかったボードゲームが\nあるんですけど……いや、でも、\nあれって結構高かったっけ……？\nシノブさんにおねだりするのは……", 10, 11, 31114086, 0, 0, 0.5);
