INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (34314, 1, 1, 100711, "オマエたち、よくわかってるプレゼント\n本当にありがとうなの～♪\n次から誕生日だけじゃなくて、\nお盆と命日にもプリンを寄こすの～", 10, 11, 34314081, 0, 0, 0.5);
