INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (34314, 1, 1, 102211, "ちょっと、欲張り過ぎでしょう！？\n一年に何回もこんなことしたら、\nランドソルからプリンが\n消えちゃうわよ！", 10, 11, 34314086, 0, 0, 0.5);
