INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (35314, 1, 1, 103611, "でも、お返しとかあるでしょ？\nちゃんとみんなに、同じくらい\n立派なお礼を用意しないと！", 10, 11, 35314068, 0, 0, 0.5);
